import Footer from '../../components/footer/Footer';
import Header from '../../components/Header';
import Teste from '../../components/NavHeader/NavHeader';
import React, { useState, useEffect } from "react";
import axios from 'axios';

const Jogo = () => {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    axios.get("https://shark-app-6myi8.ondigitalocean.app/api/lives?populate=*")
      .then((response) => {
        const { data } = response.data;
        setPosts(data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <>
      <Teste />
      <Header />
      {posts.map((post) => (
        <iframe width="760" height="515" src={post?.attributes.link}></iframe>
      ))}
      <Footer />
    </>
  );
};

export default Jogo;
